import Soccer_Svg from "../static/Soccer_Ball_Background";
import { withProps } from "../util";
import {
  FiMail,
  FiCalendar,
  FiCreditCard,
  FiChevronRight,
  FiChevronDown,
  FiPhone,
  FiMessageCircle,
} from "react-icons/fi";
import styled from "styled-components";

const MessageNotification = styled(FiMessageCircle)`
    color:${({ messages }) => (messages > 0 ? "red" : "inherit")}

    &:after{
      content:${({ messages }) => (messages > 0 ? messages : "")};
      position:absolute;
      top:0;
    }
`;

const Icon = ({ type, ...props }) => {
  switch (type) {
    case "soccer":
      return (
        <Soccer_Svg
          style={{ height: "10px", width: "10px", opacity: 1 }}
          color={"black"}
        />
      );
      break;
    case "mail":
      return withProps(FiMail, props);
      break;
    case "card":
      return withProps(FiCreditCard, props);
      break;
    case "calendar":
      return withProps(FiCalendar, props);
      break;
    case "arrow_right":
      return withProps(FiChevronRight, props);
      break;
    case "arrow_down":
      return withProps(FiChevronDown, props);
      break;
    case "phone":
      return FiPhone;
      break;
  }
};
export default Icon;
